SELECT MIN("supplier"."s_suppkey") as agg_0 FROM "supplier"  WHERE ("supplier"."s_name" IN ('Supplier#000002659', 'Supplier#000002662', 'Supplier#000002664', 'Supplier#000002660', 'Supplier#000002663', 'Supplier#000002665', 'Supplier#000002661', 'Supplier#000000001', 'Supplier#000002666') OR "supplier"."s_city" NOT LIKE '%PER%U%') AND "supplier"."s_phone" != '19-269-807-3861' AND "supplier"."s_nation" NOT LIKE '%BR%AZIL%'